column8:
バズリクソンズの定番モデル、ヴィンテージスエットのセットインスリーブ「無地バージョン」です。<br><br>

セットインスリーブスエットが2011年秋よりスエットボディがアップデートされ、ヴィンテージのディーティールはそのままに、色・サイズ等を新たに見直されたニューモデルです。<br><br>

コットン100パーセントのヘビーオンス スエット素材（ウラ起毛）、脇に継ぎ目のない丸胴編みボディ、セットインスリーブ仕様、前Vガゼット付き、約9cm幅の幅広リブ、４本針ミシンステッチなど、ヴィンテージ・スエットのディテールを余すところなく再現。<br>
ウォッシュ加工がなされており、軽いアタリ感が付けられています。<br><br>

No./BR65622<br>
マテリアル：コットン100%<br>
カラー：オートミール<br><br>

実寸目安（約 cm）<br>
　　　　肩幅 / 胸幅 / 着丈 / ソデ丈 <br>
サイズ S: 38 / 49 / 62 / 62cm<br>
サイズ M: 41 / 52 / 65 / 65cm<br>
